import VeLine from 'v-charts/lib/line';
import BasicContainer from '@vue-materials/basic-container';
import axios from 'axios';
export default {
  components: {
    VeLine: VeLine,
    BasicContainer: BasicContainer
  },
  name: 'LineChart',
  data: function data() {
    return {};
  },
  created: function created() {
    this.chartData = {
      columns: ['日期', '报修数量'],
      rows: [{
        '报修数量': 0,
        '日期': '5月31日'
      }, {
        '报修数量': 0,
        '日期': '6月1日'
      }, {
        '报修数量': 1,
        '日期': '6月2日'
      }, {
        '报修数量': 1,
        '日期': '6月3日'
      }, {
        '报修数量': 0,
        '日期': '6月4日'
      }]
    };
    this.chartSettings = {
      metrics: ['报修数量'],
      dimension: ['日期']
    };
  },
  methods: {
    getData: function getData() {
      var _this = this;

      axios.get('http://localhost:8080/GetLine').then(function (response) {
        console.log(response.data);
        var num = response.data;

        _this.chartData.rows.push({
          '报修数量': num,
          '日期': '6月5日'
        });
      }).catch(function (error) {
        console.log(error);
      });
    }
  },
  mounted: function mounted() {
    this.getData();
  }
};
